import React from 'react';
import TitleTextButton from './HomePage/TitleTextButton/TitleTextButton'
import { withRouter } from 'react-router-dom'; 
import { componentList, featuresList1, featuresList2 } from '../ComponentData'
const HomePage = (props) => {
    return (
        <div className="DI_homePage_main"> 
            {componentList.map((data,i)=>{
                return (
                    <TitleTextButton key={i} {...data}  createOrganisation={()=>props.history.push('./CreateOrganisation')}/>
                )
            })
            }
            <div className="DI_HP_Feature_wrapper">
            {featuresList1 && featuresList1.length > 0 && featuresList1.map((data,i)=>{
                return (
                    <FeatureItem key={i} data={data}/>
                )
            })
            }
            {featuresList2 && featuresList2.length > 0 && featuresList2.map((data,i)=>{
                return (
                    <FeatureItem key={i} data={data}/>
                )
            })
            }
            </div>
        </div>
    )
}

export default withRouter(HomePage);
